import "./App.css";

function App() {
  return <List />;
}

function List() {
  let toDo = ["laundry", "coding"];

  return (
    <ul>
      {toDo.map((item) => (
        <li>{item}</li>
      ))}
    </ul>
  );
}

export default App;
